import { useState } from "react";
import { useNavigate, Link } from "react-router-dom";
import googleIcon from "../img/btn_google.png";
import appleIcon from "../img/btn_apple.png";
import dogImg from "../img/dog.png";
import heoImg from "../img/heo.png";
import kongImg from "../img/kong.png";
import "./Login.css";


export default function Login() {
  const navigate = useNavigate();
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");

  const handleLogin = (e) => {
    e.preventDefault();
    console.log("Email:", email, "Password:", password);
    navigate("/");
  };

  return (
    <div className="login-container">
      {/* Bên trái slideshow */}
      <div className="login-left">
        <button className="btn-back" onClick={() => navigate("/")}>
          ⬅ Back to Home
        </button>

       <div className="slideshow">
          <div className="slide fade">
            <img src={dogImg} alt="slide1" />
          </div>
          <div className="slide fade">
            <img src={heoImg} alt="slide2" />
          </div>
          <div className="slide fade">
            <img src={kongImg} alt="slide3" />
          </div>
          <div className="slideshow">
  <img src={dogImg} alt="slide1" />
  <img src={heoImg} alt="slide2" />
  <img src={kongImg} alt="slide3" />
</div>

        </div>
      </div>

      {/* Bên phải form */}
      <div className="login-right">
        <h2>Sign in to your account</h2>
        <form onSubmit={handleLogin} className="login-form">
          <input
            type="email"
            placeholder="Email address"
            value={email}
            onChange={(e) => setEmail(e.target.value)}
            required
          />

          <input
            type="password"
            placeholder="Enter password"
            value={password}
            onChange={(e) => setPassword(e.target.value)}
            required
          />

          <button type="submit" className="btn-login">Sign in</button>
        </form>

        <div className="extra-links">
          <Link to="/reset-request">Forgot password?</Link>
          <p>
            Don’t have an account?{" "}
            <Link to="/signup">Sign up</Link>
          </p>
        </div>

        <div className="divider"><span>or sign in with</span></div>
       <div className="social-login">
        <button className="btn-google">
          <img src={googleIcon} alt="Google" />
          Google
        </button>

        <button className="btn-apple">
          <img src={appleIcon} alt="Apple" />
          Apple
        </button>
      </div>
      </div>
    </div>
  );
}
